import React from 'react';
import { Helmet } from 'react-helmet';

export default function SiteEcommerce() {
  return (
    <main className="bg-[#181B20] min-h-screen text-white font-sans">
      <Helmet>
        <title>Création de site e-commerce à Nantes | NovaWeb</title>
        <meta name="description" content="Développement de site e-commerce performant à Nantes et Pays de la Loire. Boutique en ligne, paiement sécurisé, SEO, accompagnement sur-mesure." />
      </Helmet>
      <section className="max-w-4xl mx-auto py-16 px-6">
        <h1 className="text-4xl font-bold mb-8 text-center">Création de site e-commerce à Nantes</h1>
        <p className="text-lg text-gray-300 mb-6 text-center">Lancez votre boutique en ligne avec un site e-commerce moderne, sécurisé et optimisé pour la conversion. Idéal pour commerçants, PME et start-up.</p>
        <ul className="list-disc list-inside text-gray-300 mb-8">
          <li>Paiement sécurisé et gestion des stocks</li>
          <li>Optimisation SEO pour Google Shopping</li>
          <li>Design responsive et expérience utilisateur</li>
          <li>Accompagnement et support</li>
        </ul>
        <p className="text-center"><a href="/contact" className="cta-btn">Demander un devis</a></p>
      </section>
    </main>
  );
}
